script: |
  super -f text -I q8524.spq | sort > q8524.out

inputs:
  - name: q8524.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE - 94 * col0 NOT BETWEEN + ( + col2 ) * + col0 - - 96 AND 69;
  - name: tab1

outputs:
  - name: q8524.out
    data: |
      51	14	96
      85	5	59
      91	47	68
